INSERT INTO `zz_shtl_type` VALUES ('5', '1', '1', 'image/shtl/jc/first/1.png', '小芳小心翼翼地把糖果藏到盒子里。', 'image/shtl/jc/first/2.png', '妈妈吃糖果。', 'image/shtl/jc/first/3.png', '小芳发现糖果不见了。', null, null, null, null, null, null, 'image/shtl/jc/first/D.png');
INSERT INTO `zz_shtl_type` VALUES ('6', '1', '2', 'image/shtl/jc/second/1.png', '小玲把盒子放地上。', 'image/shtl/jc/second/2.png', '小玲转身去摘花，小明悄悄去拿盒子。', 'image/shtl/jc/second/3.png', '小玲摘到了花，小明拿着盒子离开。', 'image/shtl/jc/second/4.png', '小玲回头发现盒子不见了。', null, null, null, null, 'image/shtl/jc/second/D.png');
INSERT INTO `zz_shtl_type` VALUES ('7', '1', '3', 'image/shtl/jc/third/1.png', '小红去商店买糖果。', 'image/shtl/jc/third/2.png', '袋子破了，糖果开始掉落。', 'image/shtl/jc/third/3.png', '糖果掉了一路。', 'image/shtl/jc/third/4.png', '小红回家发现糖果没了。', null, null, null, null, 'image/shtl/jc/third/D.png');
INSERT INTO `zz_shtl_type` VALUES ('8', '1', '4', 'image/shtl/jc/four/1.png', '小星在远处看到小美在吃冰淇淋。', 'image/shtl/jc/four/2.png', '小星坐在小美旁边看他开心地吃冰淇淋。', 'image/shtl/jc/four/3.png', '小星伸手拿小美手中的冰淇淋。', 'image/shtl/jc/four/4.png', '小星拿着小美的冰淇淋离开了。', null, null, null, null, 'image/shtl/jc/four/D.png');
INSERT INTO `zz_shtl_type` VALUES ('9', '2', '1', 'image/shtl/jj/first/1.png', '晨晨在穿裤子。', 'image/shtl/jj/first/2.png', '晨晨在穿上衣。', 'image/shtl/jj/first/3.png', '晨晨照镜子发现衣服穿反了。', 'image/shtl/jj/first/4.png', '晨晨脱衣服。', 'image/shtl/jj/first/5.png', '晨晨重新穿好了衣服。', null, null, 'image/shtl/jj/first/D.png');
INSERT INTO `zz_shtl_type` VALUES ('10', '2', '2', 'image/shtl/jj/second/1.png', '同学们正在专心听课。', 'image/shtl/jj/second/2.png', '突然，小刚迟到了，走进教室低着头。', 'image/shtl/jj/second/3.png', '接着，小红又迟到了，老师生气地指着她。', 'image/shtl/jj/second/4.png', '老师不小心碰到水杯了，水往外溢。', 'image/shtl/jj/second/5.png', '小红闷闷不乐，水杯从桌上掉下去了。', null, null, 'image/shtl/jj/second/D.png');
INSERT INTO `zz_shtl_type` VALUES ('11', '2', '3', 'image/shtl/jj/third/1.png', '明明坐在座位上，静静提着2袋东西站其身旁。', 'image/shtl/jj/third/2.png', '袋子破了，东西洒落在地。', 'image/shtl/jj/third/3.png', '明明帮静静捡东西。', 'image/shtl/jj/third/4.png', '明明主动给静静让座。', 'image/shtl/jj/third/5.png', '静静坐在了明明的位置上。', null, null, 'image/shtl/jj/third/D.png');
INSERT INTO `zz_shtl_type` VALUES ('12', '2', '4', 'image/shtl/jj/four/1.png', '小刚和小强想玩小明的球。', 'image/shtl/jj/four/2.png', '小明一个人踢球，小刚和小强在商量。', 'image/shtl/jj/four/3.png', '小刚和小强偷偷地在地上挖洞。', 'image/shtl/jj/four/4.png', '小刚和小强示意小明过来玩。', 'image/shtl/jj/four/5.png', '小明掉进了坑里，小刚和小强拿到了球。', 'image/shtl/jj/four/6.png', '小明和小强拿球就跑。', 'image/shtl/jj/four/D.png');
INSERT INTO `zz_sysb_type` VALUES ('1', null, '1', '小明刚开始一份新工作。一天，他和新朋友小强在咖啡间聊天。小强问：“你妻子是做什么的,”小明回答：“她是个律师。”过了一会儿，李志生气地走进了咖啡间说：“我刚刚接了个糟糕的电话，律师都是那么贪婪傲慢，我无法忍受他们。”小强问李志：“你要看一下这些报告吗？”她回答道：“现在不要，我想要杯咖啡。”', 'image/story/故事1.jpg', 'image/story/故事1.1.png', '', '', null, '0');
INSERT INTO `zz_sysb_type` VALUES ('2', null, '2', '张梅的丈夫准备为她的生日举办一个惊喜派对。他邀请了张梅的一个朋友田欣，并且告诉她：“不要告诉任何人，尤其是张梅。”派对的前一天，张梅在田欣家里，张梅不小心把咖啡洒在了一条挂在椅子上的新裙子上。田欣说：“噢～我本打算穿这件衣服去参加你的派对。”张梅问：“什么派对？”田欣说：“快来，我们看看能不能把这些污渍去掉。”', 'image/story/故事2.jpg', 'image/story/故事2.1.png', '', null, null, '0');
INSERT INTO `zz_sysb_type` VALUES ('3', null, '3', '小敏刚搬进了新公寓。她去购物，买了些新窗帘挂在卧室。在她刚装饰完公寓的时候，她最好的朋友圆圆过来了。小敏带她参观了自己的新公寓，问道：“你觉得我的卧室怎么样，”“那些窗帘很难看，”圆圆回答说：“我希望你能换个新的。” \r', 'image/story/故事3.jpg', 'image/story/故事3.1.png', '', null, null, '0');
INSERT INTO `zz_sysb_type` VALUES ('4', null, '4', '阳阳买了个水晶碗作为结婚礼物送给她的朋友小美。小美举行了盛大的婚礼，收到了很多礼物，多到记不过来。大约一年以后，阳阳在小美家吃晚饭。阳阳没拿稳酒瓶，酒瓶刚好砸在了水晶碗上，水晶碗碎了。阳阳说：“真对不起，我打碎了这个碗。”小美说：“没关系，我一直不喜欢这个碗，不知道是谁在婚礼上送的礼物。”', 'image/story/故事4.jpg', 'image/story/故事4.1.png', '', null, null, '0');
INSERT INTO `zz_sysb_type` VALUES ('5', null, '5', '苏丹的表弟雷雷要来拜访苏丹，于是苏丹特地为他做了个苹果沙拉。晚饭后，苏丹说：“我为你做了个沙拉，就在厨房里。”雷雷答道：“嗯，闻起来真香，我很爱吃沙拉，当然，除了苹果味的。”\r', 'image/story/故事5.jpg', 'image/story/故事5.1.png', '', null, null, '0');
INSERT INTO `zz_sysb_type` VALUES ('6', null, '6', '圆圆是个三岁女孩，有一张圆脸和金色短发。她在张阿姨家里。门铃响了，张阿姨去开门。按门铃的是张阿姨的邻居静静。“你好，”张阿姨说：“谢谢你顺道过来。”静静说：“你好。”然后又看了看圆圆说：“我想我没见过这个小男孩，你叫什么名字？” ', 'image/story/故事6.jpg', 'image/story/故事6.1.png', '', null, null, '0');
INSERT INTO `zz_sysb_type` VALUES ('7', null, '7', '软件设计公司的经理王强召集所有员工开会。“我有事想告诉你们。” 王强说道：“我们的会计李明先生得了癌症，病得非常厉害，现在正在医院接受治疗。”所有人都沉默了，静静消化这个消息。这时，一个软件工程师赵海迟到了。“我昨晚听了个特别搞笑的笑话，”他说：“猜猜癌症晚期的病人会对他的医生说什么，”王强说：“好吧，让我们讨论正事吧。”', 'image/story/故事7.jpg', 'image/story/故事7.1.png', '', null, null, '0');
INSERT INTO `zz_sysb_type` VALUES ('8', null, '8', '9岁的男孩王洪转学到一所新学校。有一天，他在学校卫生间的隔间里。这时，另外两个男孩，李阳和王奇走进来在洗手池边聊天。李阳说：“你知道班里那个新生吗，他叫王洪，你不觉得他看上去很奇怪吗，而且他长得好矮啊。”王洪从隔间中走出来，李阳和王奇看到了他。王奇说：“你好，王洪，你现在想去踢球吗？”', 'image/story/故事8.jpg', 'image/story/故事8.1.png', '', null, null, '0');
INSERT INTO `zz_sysb_type` VALUES ('9', null, '9', '希望小学举办了一场故事比赛。每个人都可以参加。几个五年级的学生也去了。一个五年级的学生芳芳很爱讲故事，也参加了比赛。几天后，比赛结果公布了，芳芳的故事没有拿到任何奖项。而她的同学玲玲得了一等奖。第二天，芳芳和玲玲坐在长凳上，他们看着玲玲的奖杯。玲玲说：“赢得比赛简直小菜一碟，其他的故事都太烂了。”“你打算把奖杯放哪儿呢？”芳芳问。', 'image/story/故事9.jpg', 'image/story/故事9.1.png', '', null, null, '0');
INSERT INTO `zz_sysb_type` VALUES ('10', null, '10', '王浩在一家餐厅里，不小心把咖啡洒在了地上。“我再给您拿一杯咖啡，”服务员说。服务员离开了一会儿。餐厅里的另一个顾客李刚，正在收银台前排队买单。王浩走到李刚面前说：“我把咖啡洒了，你能帮我擦一下吗？”', 'image/story/故事10.jpg', 'image/story/故事10.1.png', '', null, null, '0');
